insert  into `contents`(`id`,`title`,`content`,`created`,`modified`) values (1,'About Us','<h2 align=\"center\" style=\"text-align:center\"><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0D0D0D;mso-bidi-font-style:italic\"><b>COMPANY PROFILE</b><o:p></o:p></span></h2><h2><i><u><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0D0D0D\"><b>THE MISSION</b></span></u></i><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:#0D0D0D\"><o:p></o:p></span></h2><p style=\"text-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial;color:#0D0D0D;mso-bidi-font-style:italic\">&nbsp;&nbsp;&nbsp;&nbsp; We are entrusted to uphold and alleviate\r\nthe healthcare services in our country by providing excellent services in the\r\nsale and distribution of pharmaceutical products, hospital consumables and\r\nequipment. </span><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0D0D0D\"><o:p></o:p></span></p><p style=\"text-align:justify\"><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial;color:#0D0D0D;mso-bidi-font-weight:bold;mso-bidi-font-style:\r\nitalic\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We acknowledge our people\r\nin the company as our most important resource and we are committed to their\r\npersonal development and career growth. </span><span style=\"font-size:11.0pt;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0D0D0D\"><o:p></o:p></span></p><p style=\"text-align:justify\"><span style=\"fon